import React from 'react';

function MatchResultsPanel({ matchResults }) {
  if (!matchResults || !matchResults.winners || matchResults.winners.length === 0) {
    return null;
  }

  const { winners, challenge, scores } = matchResults;
  const isTie = winners.length > 1;

  return (
    <div className="card fade-in" style={{ marginBottom: "var(--space-xl)" }}>
      <div className="card-header">
        <h3 style={{ margin: 0, fontSize: "1.25rem" }}>
          <i className="fas fa-trophy"></i> Match Results
        </h3>
      </div>

      <div className="card-body">
        {challenge && (
          <div className="alert alert-info" style={{ marginBottom: "var(--space-md)" }}>
            <div className="d-flex justify-content-between align-items-center">
              <div>
                <strong><i className="fas fa-code-branch"></i> Challenge:</strong> {challenge.title}
              </div>
              <div>
                <span className="badge badge-primary">
                  <i className="fas fa-vial"></i> {challenge.visibleTestCount} visible, {challenge.hiddenTestCount} hidden tests
                </span>
              </div>
            </div>
          </div>
        )}

        <div style={{ marginBottom: "var(--space-lg)" }}>
          <h4 style={{ 
            fontSize: "1.1rem", 
            marginBottom: "var(--space-md)",
            color: "var(--primary)",
            borderBottom: "1px solid var(--border)",
            paddingBottom: "var(--space-xs)"
          }}>
            <i className={`fas ${isTie ? "fa-users" : "fa-crown"}`}></i> {isTie ? 'Winners (Tie)' : 'Winner'}
          </h4>
          <div className="winners-list">
            {winners.map((winner) => (
              <div key={winner.socketId} className="winner-item" style={{
                padding: "var(--space-md)",
                backgroundColor: "var(--primary-light)",
                borderRadius: "var(--radius-md)",
                marginBottom: "var(--space-sm)",
                border: "1px solid var(--primary-border)"
              }}>
                <div className="d-flex justify-content-between align-items-center">
                  <div>
                    <span style={{ fontWeight: 600, fontSize: "1.1rem" }}>
                      <i className="fas fa-medal"></i> {winner.username}
                    </span>
                  </div>
                  <div>
                    <span className="badge badge-success" style={{ fontSize: "0.9rem" }}>
                      {winner.score} points
                    </span>
                  </div>
                </div>
              </div>
            ))}
          </div>
        </div>

        <div>
          <h4 style={{ 
            fontSize: "1.1rem", 
            marginBottom: "var(--space-md)",
            color: "var(--text-dark)",
            borderBottom: "1px solid var(--border)",
            paddingBottom: "var(--space-xs)"
          }}>
            <i className="fas fa-list-ol"></i> All Scores
          </h4>
          <div className="scores-list">
            {Object.entries(scores)
              .sort((a, b) => b[1] - a[1]) // Sort by score (highest first)
              .map(([socketId, score], index) => {
                // Find player name from winners array
                const player = winners.find(w => w.socketId === socketId);
                const playerName = player ? player.username : 'Unknown Player';
                const isWinner = winners.some(w => w.socketId === socketId);

                return (
                  <div key={socketId} className="score-item" style={{
                    padding: "var(--space-sm) var(--space-md)",
                    backgroundColor: isWinner ? "var(--success-light)" : "var(--surface)",
                    borderRadius: "var(--radius-md)",
                    marginBottom: "var(--space-xs)",
                    border: isWinner ? "1px solid var(--success-border)" : "1px solid var(--border)"
                  }}>
                    <div className="d-flex justify-content-between align-items-center">
                      <div>
                        <span style={{ fontWeight: isWinner ? 600 : 400 }}>
                          {index + 1}. {playerName} {isWinner && <i className="fas fa-crown" style={{ color: "var(--warning)" }}></i>}
                        </span>
                      </div>
                      <div>
                        <span className={`badge ${isWinner ? "badge-success" : "badge-secondary"}`}>
                          {score} points
                        </span>
                      </div>
                    </div>
                  </div>
                );
              })}
          </div>
        </div>
      </div>

      <div style={{ marginTop: '15px', fontSize: '14px', color: '#666', padding: '0 15px 15px' }}>
        <p><strong>Scoring:</strong> 10 points per hidden test case passed, 1 point per visible test case during development.</p>
      </div>
    </div>
  );
}

export default MatchResultsPanel;
